var controller = new ScrollMagic.Controller();



// Fadein effect
// loop through all elements
$('.fade-in').each((function() {
  
  // build a tween
  var tweenfade = TweenMax.from($(this), 0.7, {autoAlpha: 0, y: '+=200', x: '0', ease:Linear.easeNone});

  // build a scene
  var scene = new ScrollMagic.Scene({
    triggerElement: this,
	triggerHook: 0.8,
	offset: 0,
  reverse: true
  })
  .setTween(tweenfade)
  .addTo(controller);
  
}));



// Intro animation
var introTl = new TimelineMax();
introTl
  .to($("#bamboo-img"), 3, { scale: 1.2, autoAlpha: 0, ease: Power0.easeInOut })
  .to($("#hotel-img"), 1, { scale: 1.1, ease: Power0.easeInOut }, "-=2.2")
  .to($("#clouds"), 3, { autoAlpha: 0, ease: Power0.easeInOut }, "-=3")
  .from($("#landing-logo"), 1, { autoAlpha: 0, ease: Power0.easeInOut })
  .from($("#dark-bg"), 1, { autoAlpha: 0, ease: Power0.easeInOut })
  .from($("#scrolldown"), 1, { autoAlpha: 0, ease: Power0.easeInOut });

var introScene = new ScrollMagic.Scene({
  triggerElement: "#landing-scroll",
  triggerHook: "onLeave",
  duration: "200%",
})
  .setTween(introTl)
  .setPin("#landing-scroll")
  .addTo(controller);

// Introduction section animation

var scene = new ScrollMagic.Scene({
  triggerElement: "#introduction",
  duration: "200%",
  triggerHook: "onCenter",
})
  .setTween("#logo-overlay-01", { y: "80%", ease: Linear.easeNone })
  .addTo(controller);

// Discover section animation

var scene = new ScrollMagic.Scene({
  triggerElement: "#discover",
  duration: "200%",
  triggerHook: "onCenter",
})
  .setTween(".discover-section__bg", { y: "80%", ease: Linear.easeNone })
  .addTo(controller);




// Offer section animation

var scene = new ScrollMagic.Scene({
  triggerElement: "#offer",
  duration: "200%",
  triggerHook: 1,
})
  .setTween(".offers-section__bg", { y: "80%", ease: Linear.easeNone })
  .addTo(controller);


// Flatpicker Datepicker

flatpickr("#checkIn", {
  dateFormat: "d.m.Y",
  minDate: "today",
});

flatpickr("#checkOut", {
  dateFormat: "d.m.Y",
  minDate: "today",
});

// Select2
$(".custom-select").select2({
  width: "100%",
  minimumResultsForSearch: -1,
});

// slick slider ====================

// rooms slider

$(".rooms-slider").slick({
  infinite: true,
  slidesToShow: 4,
  slidesToScroll: 1,
  arrows: false,
  dots:false,
  autoplay: true,
  autoplaySpeed: 2000,
  lazyLoad: 'ondemand',
  responsive: [
    {
      breakpoint: 1025,
      settings: {
        slidesToShow: 3,
        slidesToScroll: 3,
        infinite: true,
        dots: true
      }
    },
    {
      breakpoint: 600,
      settings: {
        slidesToShow: 2,
        slidesToScroll: 2
      }
    },
    {
      breakpoint: 480,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1
      }
    }
    
  ]
});
$((function () {
  $(".prev-slide").click((function (e) {
    $(".rooms-slider").slick("slickNext");
  }));

  $(".next-slide").click((function (e) {
    $(".rooms-slider").slick("slickPrev");
  }));
}));

// Offer slider

$(".offer-slider").slick({
  infinite: true,
  slidesToShow: 1,
  slidesToScroll: 1,
  arrows: false,
  autoplay: true,
  dots:false,
  autoplaySpeed: 2000,
});
$((function () {
  $(".prev-slide").click((function (e) {
    $(".offer-slider").slick("slickNext");
  }));

  $(".next-slide").click((function (e) {
    $(".offer-slider").slick("slickPrev");
  }));
}));

// Reviews slider

$(".reviews-slider").slick({
  infinite: true,
  slidesToShow: 1,
  slidesToScroll: 1,
  arrows: false,
  dots:true,
  autoplay: true,
  autoplaySpeed: 2000,
});

// Preloader

$(window).on('load', (function() { // makes sure the whole site is loaded 
  $('.loader').fadeOut(); // will first fade out the loading animation 
  $('#overlayer').delay(350).fadeOut('slow'); // will fade out the white DIV that covers the website. 
  $('body').delay(350).css({'overflow':'visible'});
}))